import './App.css';
import Dangnhap from './components/Dangnhap';
import { ToastContainer } from 'react-toastify';
function App() {
  return (
    <div className="App">
     <Dangnhap />
     <ToastContainer
        position="top-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="colored"
      />
    </div>
  );
}

export default App;
